window.bookSummaryJSON = "<p>With a new Chosen coming forward, Shanti has lost sight of her duty. With her plans unraveling, she does the only thing she can think of - free her brother and a mysterious stranger from a Graygual camp before heading back to beg for Cayan's aid. </p> <p>Unfortunately, that stranger was precious to the enemy, guarded by one of the elite. A Superior Officer known as the Hunter, this man always catches his prey, and his focus is now on the elusive, violet-eyed girl and the man she ripped from his hands. </p> <p>With danger mounting and one of the best constantly on her heels, Shanti will learn that running will never be enough. </p> <p>She will unite them with her suffering and lead them with her love. </p>"; 
